import React, { useEffect } from "react";
import web from "../src/images/landing.png";
import Common from "./Common";
import Aos from "aos";
import "aos/dist/aos.css";

const Home = () => {
  return (
    <>
      <Common
        name="Grow your business with"
        imgsrc={web}
        visit="/service"
        btname="Get Started"
      />
    </>
  );
};

export default Home;
